import React from "react";
import { Routes, Route, useLocation, Link } from "react-router-dom";

// (ÌïÑÏöîÏãú Navbar importÎäî Ïû†Ïãú Ï£ºÏÑù Ï≤òÎ¶¨Ìï¥ÏÑú Î≥ÄÏàòÎ•º ÏµúÏÜåÌôî)
// import Navbar from "./components/Navbar";
import DiagnosisList from "./pages/DiagnosisList";
import Diagnosis from "./components/diagnosis/Diagnosis";

function DebugBar() {
  const loc = useLocation();
  return (
    <div
      style={{
        position: "fixed",
        bottom: 0,
        left: 0,
        right: 0,
        padding: "8px 12px",
        background: "#1f2937",
        color: "#a7f3d0",
        fontSize: 12,
        zIndex: 9999,
      }}
    >
      <strong>Path:</strong> {loc.pathname}
      {"  "} |{" "}
      <Link to="/" style={{ color: "#93c5fd", textDecoration: "underline" }}>
        /
      </Link>
      {"  "} |{" "}
      <Link
        to="/diagnosis-list"
        style={{ color: "#93c5fd", textDecoration: "underline" }}
      >
        /diagnosis-list
      </Link>
      {"  "} | ÏòàÏãú:{" "}
      <Link
        to="/diagnosis/5012"
        style={{ color: "#93c5fd", textDecoration: "underline" }}
      >
        /diagnosis/5012
      </Link>
    </div>
  );
}

class ErrorBoundary extends React.Component {
  constructor(props) {
    super(props);
    this.state = { hasError: false, error: null };
  }
  static getDerivedStateFromError(error) {
    return { hasError: true, error };
  }
  componentDidCatch(error, info) {
    console.error("üí• Render error:", error, info);
  }
  render() {
    if (this.state.hasError) {
      return (
        <div style={{ padding: 24, color: "#fee2e2", background: "#7f1d1d" }}>
          <h2>Î†åÎçî Ï§ë Ïò§Î•ò Î∞úÏÉù</h2>
          <pre style={{ whiteSpace: "pre-wrap" }}>
            {String(this.state.error)}
          </pre>
        </div>
      );
    }
    return this.props.children;
  }
}

export default function App() {
  return (
    <ErrorBoundary>
      <div className="bg-gray-900 text-white min-h-screen">
        {/* NavbarÎäî ÏùºÎã® Ï£ºÏÑù. Ïó¨Í∏∞ÏÑúÎèÑ ÏóêÎü¨ÎÇòÎ©¥ Ï†ÑÏ≤¥Í∞Ä Ïïà Î≥¥Ïùº Ïàò ÏûàÏùå */}
        {/* <Navbar ... /> */}

        <main className="container mx-auto p-6 pt-24">
          <Routes>
            {/* ‚úÖ Î£®Ìä∏ ÌôïÏù∏Ïö© ÎùºÏö∞Ìä∏ */}
            <Route
              path="/"
              element={
                <div className="bg-[#1f2937] rounded-xl p-8">
                  <h1 className="text-2xl font-bold mb-2">‚úÖ Router OK</h1>
                  <p className="text-gray-300 mb-4">
                    Ïù¥ ÌôîÎ©¥Ïù¥ Î≥¥Ïù¥Î©¥ BrowserRouter/Routes Ïó∞Í≤∞ÏùÄ Ï†ïÏÉÅÏûÖÎãàÎã§.
                  </p>
                  <div className="space-x-3">
                    <Link
                      to="/diagnosis-list"
                      className="bg-cyan-600 hover:bg-cyan-500 px-4 py-2 rounded"
                    >
                      /diagnosis-listÎ°ú Ïù¥Îèô
                    </Link>
                    <Link
                      to="/diagnosis/5012"
                      className="bg-gray-700 hover:bg-gray-600 px-4 py-2 rounded"
                    >
                      /diagnosis/5012Î°ú Ïù¥Îèô
                    </Link>
                  </div>
                </div>
              }
            />

            {/* Ïã§Ï†ú ÌéòÏù¥ÏßÄ ÎùºÏö∞Ìä∏ ÌÖåÏä§Ìä∏ */}
            <Route path="/diagnosis-list" element={<DiagnosisList />} />
            <Route path="/diagnosis/:xrayId" element={<Diagnosis />} />

            {/* ÏôÄÏùºÎìúÏπ¥Îìú: Ï†ÑÎ∂Ä Î£®Ìä∏Î°ú */}
            <Route
              path="*"
              element={
                <div>
                  Not Found ‚Üí <Link to="/">Home</Link>
                </div>
              }
            />
          </Routes>
        </main>

        <DebugBar />
      </div>
    </ErrorBoundary>
  );
}
